  false,\n\t\"url\": null,\n\t\"notes\": \"The New York City Health and Nutrition
  Examination Survey (NYC HANES) is a community-based health survey conducted by the
  New York City Department of Health and Mental Hygiene. Data was collected from June
  through December 2004. NYC HANES measured key health indicators in a sample of 1,999
  randomly selected NYC adult residents through a detailed health interview and brief
  physical exam.u00a0 NYC HANES is modeled after a similar national survey - the National
  Health and Nutrition Examination Survey (NHANES).u00a0 SAS datasets (along with
  codebooks, documentation and sample SAS programs to merge datasets and analyze the
  data) have been provided.u00a0 Correct analysis of NYC HANES data requires computer
  software able to adjust for the surveyu2019s complex design, such as SAS-callable
  SUDAAN (sample code provided) or survey modules in SAS, STATA or SPSS. u00a0u00a0\",\n\t\"license_title\":
